const html = $('Set html to scrape data').first().json.html;

// Regex to extract phone numbers and labels
const phoneRegex = /<span itemprop="telephone">\s*([\d\(\)\-\s]+)\s*<\/span>.*?<span class="smaller">(.*?)<\/span>/g;

