// Get the HTML from the previous node
const html = $input.first().json.browserHtml // Adjust if needed based on your workflow

// Clean any potential RTF or extra whitespace
const cleanedHtml = html.replace(/\\r\\n/g, "").replace(/\\\\/g, "").replace(/\s+/g, " ").trim();

// Get sheet data (firstname and lastname) from the 'Loop Over Items' node
const firstname = $('Limit number of rows to process').first().json['First Name'].trim().toLowerCase(); // e.g., "sherry"
const lastname = $('Limit number of rows to process').first().json['Last Name'].trim().toLowerCase();   // e.g., "wittenberg"

// Log the input values to verify
console.log(`Searching for: firstname="${firstname}", lastname="${lastname}"`);

// Log a snippet of the cleaned HTML for debugging
console.log(`Cleaned HTML snippet: ${cleanedHtml.substring(0, 500)}...`);

// Regex to find all card sections with names and detail links
const cardRegex = /<div class="card card-body shadow-form card-summary pt-3" data-detail-link="([^"]+)">[\s\S]*?<div class="h4">\s*([^<]+)\s*<\/div>/g;

// Extract all matches
const matches = [...cleanedHtml.matchAll(cardRegex)];
console.log(`Found ${matches.length} profile sections in HTML`);

// Variable to store the matching link
let detailLink = null;

// Step 1: Search for both firstname and lastname
console.log("Step 1: Searching for both firstname and lastname...");
for (const match of matches) {
    const link = match[1]; // e.g., "/find/person/p286nr6n68n822u00988"
    const fullName = match[2].trim().toLowerCase(); // e.g., "sherry l wittenberg"

    console.log(`Checking: "${fullName}" (link: ${link})`);

    const hasFirstName = fullName.includes(firstname);
    const hasLastName = fullName.includes(lastname);

    console.log(`- Has firstname "${firstname}": ${hasFirstName}`);
    console.log(`- Has lastname "${lastname}": ${hasLastName}`);

    if (hasFirstName && hasLastName) {
        console.log(`Match found for "${fullName}" (both names)`);
        detailLink = link;
        break; // Exit as soon as we find a match with both names
    }
}

// Step 2: If no match, search for firstname only
if (!detailLink) {
    console.log("Step 2: No match found with both names. Searching for firstname only...");
    for (const match of matches) {
        const link = match[1];
        const fullName = match[2].trim().toLowerCase();

        console.log(`Checking: "${fullName}" (link: ${link})`);

        const hasFirstName = fullName.includes(firstname);

        console.log(`- Has firstname "${firstname}": ${hasFirstName}`);

        if (hasFirstName) {
            console.log(`Match found for "${fullName}" (firstname only)`);
            detailLink = link;
            break; // Exit as soon as we find a match with firstname
        }
    }
}

// Step 3: If still no match, search for lastname only
if (!detailLink) {
    console.log("Step 3: No match found with firstname. Searching for lastname only...");
    for (const match of matches) {
        const link = match[1];
        const fullName = match[2].trim().toLowerCase();

        console.log(`Checking: "${fullName}" (link: ${link})`);

        const hasLastName = fullName.includes(lastname);

        console.log(`- Has lastname "${lastname}": ${hasLastName}`);

        if (hasLastName) {
            console.log(`Match found for "${fullName}" (lastname only)`);
            detailLink = link;
            break; // Exit as soon as we find a match with lastname
        }
    }
}

// Step 4: If still no match, set to "No match found"
const baseUrl = "https://www.truepeoplesearch.com";
const personUrl = detailLink ? `${baseUrl}${detailLink}` : "Not Found";

// Log the final result
console.log(`Final result: ${personUrl}`);

// Return the result
return [{ personUrl }];

